import React from 'react';
import './Warranty.css'; // Use the same CSS file for consistent styling

export default function Warranty4() {
  const data = [
    { item: 'Moottorijärjestelmä', part: 'Siipipyörän moottori', warranty: '2 vuotta' },
    { item: 'Anturi', part: 'Kamera', warranty: '2 vuotta' },
    { item: 'Kulutustavarat', part: 'Kuori', warranty: '1 vuosi' },
    { item: 'Kulutustavarat', part: 'Siipipyörä', warranty: '' },
    { item: 'Kulutustavarat', part: 'Suutin', warranty: 'Ei takuuta' },
  ];

  return (
    <div className="table-container">
      <table className="table">
        <thead>
          <tr>
            <th>Tuote</th>
            <th>Osat</th>
            <th>Takuuaika</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.item}</td>
              <td>{row.part}</td>
              <td>{row.warranty}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
